import React from 'react';
import Navigation from '../../components/Navigation/Navigation';
import chatotlogo from '../../assets/images/chatotlogo.png';

const Home = (props) => {
  return (
    <div>
      <Navigation />
      <img src={chatotlogo} height="60" width="120" />
    </div>
  );
};

export default Home;
